// Sidebar.js
import React from 'react';

const Sidebar = () => {
  return (
    <aside className="w-64 bg-white p-5">
      {/* Replace with your actual navigation items */}
      <nav>
        <a href="#" className="block p-2.5 text-gray-700">Dashboard</a>
        <a href="#" className="block p-2.5 text-gray-700">Profile</a>
        <a href="#" className="block p-2.5 text-gray-700">Go Live</a>
        {/* ... other navigation items ... */}
      </nav>
    </aside>
  );
};

export default Sidebar;
